import React, { CSSProperties, FC } from 'react';
import planetStyles from '../config/planet-style.json';

interface planetProps {
  name: string;
}

interface planetStyleProps {
  top: number;
  left: number;
  size: number;
  imageName: string;
}

const Planet: FC<planetProps> = ({ name }) => {
  let planetStyle: Record<string, planetStyleProps>;
  if (name === 'world') {
    const planetStyle = planetStyles.world;
  } else {
    console.error('planet name not found');
  }

  const { top, left, size } = planetStyle;

  const style: CSSProperties = {
    position: 'absolute',
    top: top + 'vh',
    left: left + '%',
    width: size + 'px',
  };

  return <img src={require('../assets/images/' + imageName)} style={style} />;
};

export default Planet;
function useWindowDimensions() {
  throw new Error('Function not implemented.');
}
